import React, { useState } from "react";
interface Props{
    children :String;
}


const TodoForm = () => {
const [imput, setimput] = useState("");

 const handle = e =>{
    e.preventDefault();
 }
  return (
    <div>
      <form className="Todo-form" onSubmit={ handle}>
        <input
          className="Todo-imput"
          type="text"
          placeholder="add new task"
          name="text"
          value={imput}
        />
        <Boutton>submit</Boutton>
      </form>
      
    </div>
  );
  const Boutton = ({children}: Props) => {
    return (
      <div>
        <button>{children}</button>
      </div>
    )
  }

  const Checkbox = () =>{
    <input type="checkbox"></input>
  }
};



export default TodoForm;
